  useEffect(() => {
    const path = pathRef.current;
    const container = containerRef.current;
    const dna = dnaRef.current;
    const dot = dotRef.current;
    
    if (!path || !container || !dna || !dot) return;

    // Get the total length of the path
    const pathLength = path.getTotalLength();
    
    // Set up the starting positions - path completely hidden
    path.style.strokeDasharray = `${pathLength} ${pathLength}`;
    path.style.strokeDashoffset = `${pathLength}`;
    path.style.transition = 'none'; // Remove any CSS transitions
    
    // Initially hide DNA group
    dna.style.opacity = '0';
    dna.style.transition = 'opacity 0.5s ease';

    // Function to update the path drawing based on scroll
    const handleScroll = () => {
      // Get current scroll position
      const scrollTop = window.pageYOffset || document.documentElement.scrollTop;
      
      // Get total scrollable height
      const documentHeight = document.documentElement.scrollHeight;
      const windowHeight = window.innerHeight;
      const maxScroll = documentHeight - windowHeight;
      
      // Calculate scroll percentage (0 at top, 1 at bottom)
      let percentage = 0;
      if (maxScroll > 0) {
        percentage = scrollTop / maxScroll;
      }
      
      // Ensure percentage is between 0 and 1
      percentage = Math.max(0, Math.min(1, percentage));
      
      // Speed zones configuration (offset goes from pathLength down to 0)
      const slowStartAt = 28712.6; // Start slowing when offset reaches this value
      const slowEndAt = 26000; // Resume normal speed at this value
      const slowFactor = 0.3; // How slow in the slow zone (0.1 = very slow, 0.9 = slightly slow)
      
      // Calculate distances for each zone
      const zone1Distance = pathLength - slowStartAt; // Distance covered in zone 1
      const zone2Distance = slowStartAt - slowEndAt;   // Distance covered in zone 2 (slow)
      const zone3Distance = slowEndAt;                 // Distance covered in zone 3
      
      // Calculate how much "effective" distance each zone represents with speed adjustments
      const zone1Effective = zone1Distance; // Normal speed = 1:1
      const zone2Effective = zone2Distance / slowFactor; // Slow speed = takes more distance
      const zone3Effective = zone3Distance; // Normal speed = 1:1
      const totalEffective = zone1Effective + zone2Effective + zone3Effective;
      
      // Calculate the effective distance traveled based on percentage
      const effectiveDistance = totalEffective * percentage;
      
      // Determine which zone we're in and calculate actual offset
      let offset;
      
      if (effectiveDistance <= zone1Effective) {
        // Zone 1: Normal speed
        offset = pathLength - effectiveDistance;
      } else if (effectiveDistance <= zone1Effective + zone2Effective) {
        // Zone 2: Slow speed
        const distanceInZone2 = effectiveDistance - zone1Effective;
        const actualDistanceInZone2 = distanceInZone2 * slowFactor;
        offset = slowStartAt - actualDistanceInZone2;
      } else {
        // Zone 3: Normal speed
        const distanceInZone3 = effectiveDistance - zone1Effective - zone2Effective;
        offset = slowEndAt - distanceInZone3;
      }
      
      // Update stroke-dashoffset
      path.style.strokeDashoffset = `${offset}`;
      
      // Show/hide DNA group based on offset value
      if (offset <= 27183.7) {
        dna.style.opacity = '1';
      } else {
        dna.style.opacity = '0';
      }
      
      // Update dot position - calculate the current visible length of the path
      const drawnLength = pathLength - offset;
      if (drawnLength > 0 && drawnLength <= pathLength) {
        const point = path.getPointAtLength(drawnLength);
        dot.setAttribute('cx', point.x);
        dot.setAttribute('cy', point.y);
        dot.style.display = 'block';
      } else {
        dot.style.display = 'none';
      }
    };

    // Use requestAnimationFrame for smoother animation
    let ticking = false;
    const requestScrollUpdate = () => {
      if (!ticking) {
        window.requestAnimationFrame(() => {
          handleScroll();
          ticking = false;
        });
        ticking = true;
      }
    };

    // Add scroll event listener with passive flag for better performance
    window.addEventListener('scroll', requestScrollUpdate, { passive: true });
    // Also listen to resize in case viewport changes
    window.addEventListener('resize', requestScrollUpdate, { passive: true });
    
    // Initial call
    handleScroll();

    // Cleanup
    return () => {
      window.removeEventListener('scroll', requestScrollUpdate);
      window.removeEventListener('resize', requestScrollUpdate);
    };
  }, []);

